<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>KDiff3 </b>est un analyseur graphique de différence de texte pour jusqu'à 3 fichiers d'entrée. Il fournit une analyse caractère par caractère et un outil de fusion de texte avec éditeur intégré. Il peut également comparer et fusionner des répertoires. Indépendant de la plate-forme.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
